import "./Style.css";

function NavbarPublic() {
  return (
    <nav className="navbar">
      <ul className="navbar-list">
        <a href="/public/aboutus">
          <li className="">Quem Somos</li>
        </a>
        <a href="/admin/profiles">
          <li className="">Quem Somos</li>
        </a>
      </ul>
    </nav>
  );
}

export default NavbarPublic;
